  const [input, setInput] = useState("");
  const [todos, setTodos] = useState([]);
  const [editTodo, setEditTodo] = useState(null);

  return (
    <div className="container">
      <div className='app-wrapper'>
        <div>
          <Header />
        </div>
        <div>
          <Form
            input={input}
            setInput={setInput}
            todos={todos}
            setTodos={setTodos}
            editTodos={editTodos}
            setEditTodos={setEditTodos}
          />
        </div>
        <div>
          <TodoList 
            todos={todos}
            setTodos={setTodos}
            setEditTodoz={setEditTodo} />
        </div>
      </div>
    </div>
  );
}

export default App;
